import React from 'react';
import MainPage from './MainPage';
import GamePage from './GamePage';

class App extends React.Component {
    constructor (props) {
        super (props);
        this.state = {
            page: '',
        };
    }
    render() {
        if (this.state.page === 'MainPage') {
            return (
                <div>
                    <MainPage />
                </div>
            );
        } else if (this.state.page === 'GamePage') {
            return (
                <div>
                    <GamePage />
                </div>
            );
        }
        return (
            <div>
                <p>Page does not exist.</p>
            </div>
        );
    }
}

App.defaultProps = {
    page: 'MainPage'
}

